export interface Category {
    id: number,
    name : string,
    open: boolean
}

export const categories = [
    {
        id: 1,
        name: 'Computers',
        open: false
    },
    {
        id: 2,
        name: 'Phones, Gadgets',
        open: false
    },
    {
        id: 3,
        name: 'TV, Audio,Video',
        open: false
    },
    {
        id: 4,
        name: 'Furniture',
        open: false
    }
];
